import React from "react";
import "./RepoCard.css";
const RepoCard = () =>{
    return (
        <>
            <div className="repo-card-div">
                <p>Name: </p>
                <p>Description : </p>
                <p>Repo Link : </p>
                <p>Language : </p>
                <p>Created at : </p>
                <p>Updated at : </p>
                <p>Pushed at : </p>
            </div>
        </>
    );
}
export default RepoCard;
